import React from 'react';
import ReactDOM from 'react-dom/client';

import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./pages/onglets/Home";
import Login from "./pages/forms/Login"
import Register from "./pages/forms/Register";
import NoPage from "./pages/NoPage";
import GoVersus from "./pages/GoVersus";
import Message from "./pages/onglets/Message";

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">

          <Route index element={<GoVersus page={<Home />} title='Home - GoVersus' />} />
          <Route path="home" element={<GoVersus page={<Home />}  title='Home - GoVersus'/>} />
          <Route path="message" element={<GoVersus page={<Message />}  title='Message - GoVersus'/>} />

          <Route path="login" element={<Login />} />
          <Route path="register" element={<Register />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>

  );
}




// initialisation
const content = document.getElementById('root');
const root = ReactDOM.createRoot(content);
root.render(<App />);
